import React from 'react';
import Logo from './assets/logo/Logo-brainflix.svg';
import './App.css';
import Header from './components/Header/Header'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={Logo} className="App-logo" alt="logo" />
        <Header />

      </header>
    </div>
  );
}

export default App;
